import React from 'react';
import './style.css';

export default function SectionBanner() {
    return (
        <div className="banner">
            <ul>
                <li className="bu">Simples</li>
                <li className="bu">100% Digital</li>
                <li className="betrigg"><span>#</span> BETRIGG </li>
            </ul>
        </div>
    );
}
